import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import Carousel from '../components/Carousel';
import SectionItem from '../components/SectionItem';

function Home() {
  return (
    <div>
      <Header />
      <Carousel />
      <main>
        <section className="photo-text-sections">
          <SectionItem
            imgSrc="/img/foto1.jpg"
            imgAlt="Foto 1"
            decorationSrc="/img/bandeirinha.png"
            title="Bem-Vindo a Festa do Pijama Petrópolis"
            text="Realizar uma festa do pijama é trazer magia à vida real! Além de super divertida..."
          />
          {/* Adicione outras seções aqui */}
        </section>
      </main>
      <Footer />
    </div>
  );
}

export default Home;
